export default class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = {}
  };

  render() {
    return (
      <Container fluid className="main-content-container px-4">
        <Row noGlutters>
          <Col md="5" lg="3">
            <Card small className="mb-4">
              HOLA
            </Card>
          </Col>
        </Row>
      </Container>
    );
  }
}
